package findcommonancestor;import java.util.*;public class MyFindCommonAncestor implements FindCommonAncestor{    public String findCommmonAncestor(String[] commitHashes,            String[][] parentHashes, String commitHash1, String commitHash2)    {        Set<String> parent1 = new HashSet<String> ();        Set<String> parent2 = new HashSet<String> ();                boolean findComitHash1 = false;        boolean findComitHash2 = false;        for (int i = 0; i < commitHashes.length; i++) {        	String commitHash = commitHashes[i];        	String[] parents = parentHashes[i];        	if (! findComitHash1) {        		if (commitHash1.equals(commitHash)) {        			findComitHash1 = true;            	}        	}         	        	if (! findComitHash2) {        		if (commitHash2.equals(commitHash)) {        			findComitHash2 = true;            	}        	}         	        	for (String parent : parents) {        		if (findComitHash1) {        			if (parent2.contains(parent)) {        				return parent;        			} else {        				parent1.add(parent);        			}        		}        		        		if (findComitHash2) {        			if (parent1.contains(parent)) {        				return parent;        			} else {        				parent2.add(parent);        			}        		}        			        	}        }           return null;    }}